import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link, useParams } from "react-router-dom";

const Career = () => {
  const actorData = useSelector((state) => state.actors.actorCredit.data);

  return (
    <div>
      <div>
        <span>Acting</span>
      </div>
      <div>
        <div className="grid grid-cols-[20%_60%_20%] justify-center mb-3">
          <span className="bg-yellow-500 flex flex-row">Year</span>
          <span>Movie / Tv Show</span>
          <span>Role</span>
        </div>
        {actorData.cast?.map((item, index) => {
          return (
            <div
              className="grid grid-cols-[20%_60%_20%] justify-center w-[100%]"
              key={index}
            >
              <div>
                {item.release_date && item.release_date
                  ? item.release_date.split("-")[0]
                  : "-"}
              </div>
              <Link to={`/movie/${item.id}`}>
                <div>{item.title}</div>
              </Link>
              <div>{item.character}</div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default Career;
